import React from 'react';
import { Link, useNavigate } from 'react-router-dom';

function Home({ setIsLoggedIn }) {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Clear the login state
    setIsLoggedIn(false);
    // Redirect to login page
    navigate('/login');
  };

  return (
    <div className="home-container">
      {/* Top Navbar with Logout Button */}
      <nav className="navbar">
        <ul>
          <li><Link to="/">Home</Link></li>
          <li><Link to="/about">About</Link></li>
          <li><Link to="/services">Services</Link></li>
          <li><Link to="/contact">Contact</Link></li>
          <li><Link to="/profile">Profile</Link></li>
          <li>
            <button onClick={handleLogout} className="logout-button">Logout</button>
          </li>
        </ul>
      </nav>

      <div className="content">
        {/* Left Sidebar with Tabs */}
        <div className="sidebar">
          <ul>
            <li><Link to="/tab1">Tab 1</Link></li>
            <li><Link to="/tab2">Tab 2</Link></li>
            <li><Link to="/tab3">Tab 3</Link></li>
            <li><Link to="/tab4">Tab 4</Link></li>
            <li><Link to="/tab5">Tab 5</Link></li>
          </ul>
        </div>

        {/* Main Content Area */}
        <div className="main-content">
          <h1>Welcome to the Home Page</h1>
          <p>This is the main content area. You can add more sections here.</p>
        </div>
      </div>
    </div>
  );
}

export default Home;
